import React from 'react'
import '../index.scss'

export default function Header() {
  return (
    <div className='Header-div'>
      <div className="left">
      <i class="fa-brands fa-facebook"></i>
      </div>
      <div className="center">Center</div>
      <div className="right">Right</div>
    </div>
  )
}
